import React from 'react'
import ItemDetail from './ItemDetail';
import { Container } from 'react-bootstrap';
import Row from 'react-bootstrap/Row';

const ItemDetailContainer = () => {
  return (
    <Container>
      <Row>
        <ItemDetail/>
      </Row>
    </Container>
)
}

export default ItemDetailContainer
